import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import fakeData from './now_playing.json';

class App extends Component {
  render() {
    const moviesList = fakeData.results;
    return (
      <div className="App">
        {
          moviesList.map((movie) => {
            return(
              <div>
                <h1>{movie.title}</h1>
                <h2>{movie.overview}</h2>
              </div>
            )
          })
        }
      </div>
    );
  }
}

export default App;
